import React from "react";
import ProductsApi from "./carsData/carsDataRes";

export default class carsCart extends React.Component {

    state = {
        products: [],
    };

    componentDidMount() {
        ProductsApi.getAll()
            .then(data => {
                this.setState({
                    products: data
                })
            });
    }

    render() {
        return (
            <div>
            </div>
        );
    }
}
